mutation SettingsSessionRowRevokeSessionMutation(
  $input: RevokeSessionInput!
) {
  revokeSession(input: $input) {
    error
    session {
      id
      expirationDate
    }
  }
}

query SettingsQueriesAuthUserQuery {
  authUser {
    id
    name
    apellidoPaterno
    apellidoMaterno
    RFC
    CURP
    clabe
    mobile
    email
    language
    ...SettingsQueries_logins_user
    ...SettingsQueries_sessions_user
  }
}

fragment SettingsQueries_logins_user on AuthUser {
  logins(first: 5, after: "", reset: 0) {
    edges {
      node {
        id
        applicationName
        time
        address
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
  id
}

fragment SettingsQueries_sessions_user on AuthUser {
  sessions(first: 5, after: "", reset: 0) {
    edges {
      node {
        id
        applicationName
        type
        deviceName
        address
        lastTimeAccessed
        expirationDate
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
  id
}

query SettingsSessionsPaginationUser(
  $count: Int = 5
  $cursor: String = ""
  $reset: Float = 0
  $id: ID!
) {
  node(id: $id) {
    __typename
    ...SettingsQueries_sessions_user_3sPmgd
    id
  }
}

fragment SettingsQueries_sessions_user_3sPmgd on AuthUser {
  sessions(first: $count, after: $cursor, reset: $reset) {
    edges {
      node {
        id
        applicationName
        type
        deviceName
        address
        lastTimeAccessed
        expirationDate
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
  id
}

